  */
  function mint(address to) public onlyOwner {
      require(mintedTokens < maxTokens, "All tokens have been minted");
      _safeMint(to, mintedTokens);
      mintedTokens++;
  }

  /**
     * @dev Override required by ERC721URIStorage to return the token URI.
